import React from 'react';

const SlotM = () => {
    let x = 'Mia';
    let y = 'Mai';
    let z = 'Mia';

    if((x ===y) && (y===z)){
        return(
            <>
                <div className='slot_inner'>

                    <h1>
                    {" "}
                    {x} {y} {z} {" "}
                    </h1>
                    <hr/>
                    <h1>This is matching.</h1>
                </div>
            </>
        );
    }else{
        return(
            <>
                <div className='slot_inner'>

                    <h1>
                    {" "}
                    {x} {y} {z} {" "}
                    </h1>
                    <hr/>
                    <h1>This is not matching.</h1>
                </div>
            </>
        );
    }
};

const App = () => {
    return (
    <>
        <h1 className='heading'> Welcome to <span style={{fontWeight:"bold"}}> Slot machine game </span> </h1>
        <SlotM />
    </>
    );
};

export default App;
